import { Link } from "react-router-dom";

function Dashboard() {
  // For now, this can be static. Later you can fetch user balance via API
  return (
    <div>
      <h2>Dashboard</h2>
      <p>Welcome, User!</p>
      <p>Your balance: $0.00</p>
      <div style={{ marginTop: "1rem" }}>
        <Link to="/users">
          <button style={{ marginRight: "1rem" }}>View/Add Users</button>
        </Link>
        <Link to="/groups">
          <button>View/Add Groups</button>
        </Link>
      </div>
    </div>
  );
}

export default Dashboard;
